script: |
  super -f tsv -I q5161.sql | sort > q5161.out

vector: true

inputs:
  - name: q5161.sql
    data: |
      SELECT 16 / - col2 + col1 FROM tab1 AS cor0 WHERE col1 + col2 NOT BETWEEN ( NULL ) AND + ( - + CAST ( col2 AS INTEGER ) ) * + 5;
  - name: tab1

outputs:
  - name: q5161.out
    data: |
      14
      47
      5
